public void testLruCache() {
    ConcurrentCommonCache<String, String> sc = new ConcurrentCommonCache<String, String>(3);
    sc.put("a", "1");
    sc.put("b", "2");
    sc.put("c", "3");
    sc.put("a", "4");
    sc.put("d", "5");
    Assert.assertArrayEquals(new String[] {"c", "a", "d"}, sc.keys().toArray(new String[0]));
